import { useState } from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'; // Change here
import Register from './components/Register';
import Login from './components/Login';
import Dashboard from './components/Dashboard';

function App() {
  const [token, setToken] = useState('');

  return (
    <Router>
      <Routes> {/* Change here from <Switch> to <Routes> */}
        <Route path="/register" element={<Register />} />
        <Route path="/login" element={<Login setToken={setToken} />} />
        <Route path="/dashboard" element={token ? <Dashboard token={token} /> : <p>Please log in</p>} />
        <Route path="/" element={<h1>Welcome to Task Manager</h1>} />
      </Routes>
    </Router>
  );
}

export default App;
